import React from "react";

import Slide_Product from "./Slide_Product";

function Top_Slide(){
    return(
        <>
         <div>
             <ol className="ol_list">
               <Slide_Product
               ></Slide_Product>
             </ol>
         </div>
        </>
    );
}

export default Top_Slide;
